import "./App.css";
import AddStudent from "./components/AddStudent";
import Header from "./components/Header";
import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
        <Header />
        <AddStudent />
      </div>
    </Router>
  );
}

export default App;
